import numpy, random, sys
from deap import base, creator, tools

aggregated_equations = ''
def generate_aggregated_equations(array_of_routing_matrices, array_of_delays):
    """ eq1 = a1, eq2 = a2 --->  abs(eq1-a1)+abs(eq2-a2)"""
    global aggregated_equations
    aggregated_equations = ''
    number_of_probes, number_of_switches = len(array_of_routing_matrices), len(array_of_routing_matrices[0])
    for probe in range(number_of_probes):
        aggregated_equations += 'abs('

        for i in range(number_of_switches):
            for j in range(number_of_switches):
                if array_of_routing_matrices[probe][i][j]:
                    aggregated_equations += ('x'+str(i*number_of_switches+j)+'+')

        aggregated_equations += '0-'+str(array_of_delays[probe])+')+'
    aggregated_equations += '0'
def eval_func(chromosome):
    tmp_aggregated_equations = aggregated_equations
    for i in range(len(chromosome)-1, -1, -1):
        tmp_aggregated_equations = tmp_aggregated_equations.replace('x'+str(i), str(abs(chromosome[i])))
        ''' genes must be positive'''
        # if chromosome[i] < 0: return pow(10, 7)
    return eval(tmp_aggregated_equations),
def chrome_initialization(min, max):
    """ return a random between min and max"""
    return numpy.random.random()+numpy.random.randint(min, max+1)
def pre_run_GA(number_of_genese_in_each_chromosome):
    creator.create("FitnessMin", base.Fitness, weights=(-1.0,))
    creator.create("Individual", list, fitness=creator.FitnessMin)

    toolbox = base.Toolbox()

    # Attribute generator
    # calling toolbox.chrom_init returns a random value between 0 and 5 using function chrome_initialization
    toolbox.register("chrom_init", chrome_initialization, 0, 0)

    # Structure initializers
    #                         define 'individual' to be an individual
    #                         consisting of number_of_genese_in_each_chromosome 'chrom_init' elements ('genes')
    # toolbox.individual is a chromose which is consist of number_of_genese_in_each_chromosome of gene. Each gene is a the output of chrom_init
    toolbox.register("individual", tools.initRepeat, creator.Individual, toolbox.chrom_init, number_of_genese_in_each_chromosome)

    # define the population to be a list of individuals
    toolbox.register("population", tools.initRepeat, list, toolbox.individual)

    #----------
    # Operator registration
    #----------
    # register the goal / fitness function
    toolbox.register("evaluate", eval_func)

    # register the crossover operator
    toolbox.register("mate", tools.cxTwoPoint)

    # register a mutation operator with a probability to
    # flip each attribute/gene of 0.05
    toolbox.register("mutate", tools.mutFlipBit, indpb=0.05)

    # operator for selecting individuals for breeding the next
    # generation: each individual of the current generation
    # is replaced by the 'fittest' (best) of three individuals
    # drawn randomly from the current generation.
    toolbox.register("select", tools.selTournament, tournsize=3)

    return toolbox

def genetic_algorithm(number_of_switches, array_of_routing_matrices, array_of_delays):
    generate_aggregated_equations(array_of_routing_matrices, array_of_delays)
    toolbox = pre_run_GA(2*number_of_switches*number_of_switches)

    # numpy.random.seed(64)

    # create an initial population of 300 individuals (where
    # each individual is a list of integers)
    pop = toolbox.population(n=number_of_switches*number_of_switches*2)

    # CXPB  is the probability with which two individuals
    #       are crossed
    #
    # MUTPB is the probability for mutating an individual
    CXPB, MUTPB = 0.5, 0.2

    print("Start of evolution")

    # Evaluate the entire population
    fitnesses = list(map(toolbox.evaluate, pop))
    for ind, fit in zip(pop, fitnesses):
        ind.fitness.values = fit

    print("  Evaluated %i individuals" % len(pop))

    # Extracting all the fitnesses of
    fits = [ind.fitness.values[0] for ind in pop]

    # Variable keeping track of the number of generations
    g = 0

    # Begin the evolution
    while max(fits) < 100 and g < 1000:
        # A new generation
        g = g + 1
        print("-- Generation %i --" % g)

        # Select the next generation individuals
        offspring = toolbox.select(pop, len(pop))
        # Clone the selected individuals
        offspring = list(map(toolbox.clone, offspring))

        # Apply crossover and mutation on the offspring
        for child1, child2 in zip(offspring[::2], offspring[1::2]):

            # cross two individuals with probability CXPB
            if numpy.random.random() < CXPB:
                toolbox.mate(child1, child2)

                # fitness values of the children
                # must be recalculated later
                del child1.fitness.values
                del child2.fitness.values

        for mutant in offspring:

            # mutate an individual with probability MUTPB
            if numpy.random.random() < MUTPB:
                toolbox.mutate(mutant)
                del mutant.fitness.values

        # Evaluate the individuals with an invalid fitness
        invalid_ind = [ind for ind in offspring if not ind.fitness.valid]
        fitnesses = map(toolbox.evaluate, invalid_ind)
        for ind, fit in zip(invalid_ind, fitnesses):
            ind.fitness.values = fit

        print("  Evaluated %i individuals" % len(invalid_ind))

        # The population is entirely replaced by the offspring
        pop[:] = offspring

        # Gather all the fitnesses in one list and print the stats
        fits = [ind.fitness.values[0] for ind in pop]

        length = len(pop)
        mean = sum(fits) / length
        sum2 = sum(x*x for x in fits)
        std = abs(sum2 / length - mean**2)**0.5

        print("  Min %s" % min(fits))
        print("  Max %s" % max(fits))
        print("  Avg %s" % mean)
        print("  Std %s" % std)

    print("-- End of (successful) evolution --")

    best_ind = tools.selBest(pop, 1)[0]
    print("Best individual is %s, %s" % (best_ind, best_ind.fitness.values))

