class genetic_algorithm:
    mut_rate, crossover_rate = 0.4, 0.5
    do_mutat = 0.1
    number_of_break_points = 2
    pop_size, generations = 100, 500
    min, max = 0, 10

    @staticmethod
    def generate_aggregated_equations(array_of_routing_matrices, array_of_delays):
        """ eq1 = a1, eq2 = a2 --->  abs(eq1-a1)+abs(eq2-a2)"""
        aggregated_equations = ''
        map_geneIndex_to_variableName = []
        number_of_probes, number_of_switches = len(array_of_routing_matrices), len(array_of_routing_matrices[0])
        for probe in range(number_of_probes):
            aggregated_equations += 'abs('

            for i in range(number_of_switches):
                for j in range(number_of_switches):
                    if array_of_routing_matrices[probe][i][j]:
                        aggregated_equations += ('x'+str(i*number_of_switches+j)+'+')
                        if ('x'+str(i*number_of_switches+j)) not in map_geneIndex_to_variableName:
                            map_geneIndex_to_variableName.append('x'+str(i*number_of_switches+j))
            aggregated_equations += '0-'+str(array_of_delays[probe])+')+'
        aggregated_equations += '0'
        return aggregated_equations.replace('+0',''), sorted(map_geneIndex_to_variableName)
    @staticmethod
    def fitness(all_chromosomes, aggregated_equations, map_geneIndex_to_variableName):
        res = []
        for chromosome in all_chromosomes:
            tmp_aggregated_equations = aggregated_equations
            for i in range(len(chromosome)-1, -1, -1):
                tmp_aggregated_equations = tmp_aggregated_equations.replace(map_geneIndex_to_variableName[i], str(chromosome[i]))
                ''' genes must be positive'''
                if chromosome[i] < 0: raise Exception('Negative value in a gene is not acceptable.')
            res.append(eval(tmp_aggregated_equations))
        return res
    @staticmethod
    def initial_population_float(number_of_genes):
        min, max = genetic_algorithm.min, genetic_algorithm.max
        two_floating_point = lambda x: float(int(x*100)/100.0)
        chrom = lambda :[two_floating_point(numpy.random.random()+numpy.random.randint(min, max+1)) for i in range(number_of_genes)]
        pop = [chrom() for i in range(genetic_algorithm.pop_size)]
        return pop
    @staticmethod
    def initial_population_integer(number_of_genes):
        min, max = genetic_algorithm.min, genetic_algorithm.max
        chrom = lambda :[numpy.random.randint(min, max+1) for i in range(number_of_genes)]
        pop = [chrom() for i in range(genetic_algorithm.pop_size)]
        return pop
    @staticmethod
    def best_chrome(fitness_values, pop):
        return pop[fitness_values.index(min(fitness_values))][:]
    @staticmethod
    def mutation_float(one_chromosome):
        two_floating_point = lambda x: float(int(x*100)/100.0)
        for gene_ind in range(len(one_chromosome)):
            if numpy.random.random() < genetic_algorithm.mut_rate:
                one_chromosome[gene_ind] = two_floating_point(numpy.random.random()*(genetic_algorithm.max-genetic_algorithm.min) + genetic_algorithm.min)
        return one_chromosome
    @staticmethod
    def mutation_float_smooth(one_chromosome):
        two_floating_point = lambda x: float(int(x*100)/100.0)
        for gene_ind in range(len(one_chromosome)):
            if numpy.random.random() < genetic_algorithm.mut_rate:
                one_chromosome[gene_ind] = two_floating_point(abs(1-2*numpy.random.random()+one_chromosome[gene_ind]))
        return one_chromosome
    @staticmethod
    def mutation_int(one_chromosome):
        min, max = genetic_algorithm.min, genetic_algorithm.max
        for gene_ind in range(len(one_chromosome)):
            if numpy.random.random() < genetic_algorithm.mut_rate:
                one_chromosome[gene_ind] = abs(numpy.random.randint(min, max))
        return one_chromosome
    @staticmethod
    def crossover_mov(mom_chrom, dad_chrom):
        number_of_gene = len(mom_chrom)
        jump_window = int(number_of_gene / genetic_algorithm.number_of_break_points)
        chld1, chld2 = list(mom_chrom), list(dad_chrom)
        for i in range(genetic_algorithm.number_of_break_points):
            break_point = numpy.random.randint(i*jump_window, (i+1)*jump_window+1)
            chld1[i*jump_window:break_point] = dad_chrom[i*jump_window:break_point]
            chld2[i*jump_window:break_point] = mom_chrom[i*jump_window:break_point]
        return chld1, chld2
    @staticmethod
    def crossover_mean(mom_chrom, dad_chrom):
        number_of_gene = len(mom_chrom)
        jump_window = int(number_of_gene / genetic_algorithm.number_of_break_points)
        chld1 = list(mom_chrom)
        for i in range(genetic_algorithm.number_of_break_points):
            break_point = numpy.random.randint(i*jump_window, (i+1)*jump_window+1)
            chld1[i*jump_window:break_point] = dad_chrom[i*jump_window:break_point]
        chld2 = [(mom_chrom[i]+dad_chrom[i])/2 for i in range(len(mom_chrom))]
        return chld1, chld2
    @staticmethod
    def roulette(fitness_values, pop, n):
        total = sum(fitness_values)
        i = 0
        w, v = fitness_values[0], 0
        while n:
            x = total * (1 - numpy.random.random() ** (1.0 / n))
            total -= x
            while x > w:
                x -= w
                i += 1
                w, v = fitness_values[i], i
            w -= x
            yield pop[v]
            n -= 1
    @staticmethod
    # Use many tournaments to get parents
    def tournament(fitness_values, pop, n, tsize=5):
        for i in range(n):
            candidates = random.sample(range(len(fitness_values)), tsize)
            yield pop[max(candidates, key=lambda x: fitness_values[x])]
    @staticmethod
    def step_mut_fix(pop, aggregated_equations, map_geneIndex_to_variableName, fitness_values=None):
        if fitness_values is None: fitness_values = genetic_algorithm.fitness(pop[:], aggregated_equations[:], map_geneIndex_to_variableName[:])
        newpop = [genetic_algorithm.best_chrome(fitness_values, pop)]
        parents = SELECTION(fitness_values[:], pop[:], len(pop) + 1) # one extra for final crossover
        while len(newpop) < len(pop):
            if numpy.random.random() < genetic_algorithm.crossover_rate:
                # crossover and mutation in a sequential manner
                # newpop.extend(map(MUT, XOVER(parents.next(), parents.next())))
                newpop.extend(map(MUT, XOVER(parents.__next__(), parents.__next__())))
                # newpop.extend(XOVER(parents.next(), parents.next()))
            else:
                newpop.append(MUT(parents.__next__()))
        if len(newpop) > len(pop): newpop.pop(-1)
        return newpop
    @staticmethod
    def step_no_mut_fix(pop, aggregated_equations, map_geneIndex_to_variableName, fitness_values=None):
        if fitness_values is None: fitness_values = genetic_algorithm.fitness(pop[:], aggregated_equations[:], map_geneIndex_to_variableName[:])
        newpop = [genetic_algorithm.best_chrome(fitness_values, pop)]
        parents = SELECTION(fitness_values[:], pop[:], len(pop) + 1) # one extra for final crossover
        while len(newpop) < len(pop):
            if numpy.random.random() < genetic_algorithm.crossover_rate:
                # crossover and mutation in a sequential manner
                if numpy.random.random() < genetic_algorithm.do_mutat:
                    newpop.extend(map(MUT, XOVER(parents.next(), parents.next())))
                else:
                    newpop.extend(XOVER(parents.next(), parents.next()))
                # newpop.extend(XOVER(parents.next(), parents.next()))
            else:
                if numpy.random.random() < genetic_algorithm.do_mutat:
                    newpop.append(MUT(parents.next()))
                else:
                    newpop.extend([parents.next(), parents.next()])

        return newpop
    @staticmethod
    def search_local(pop, aggregated_equations, map_geneIndex_to_variableName, fitness_values=None):
        if fitness_values is None: fitness_values = genetic_algorithm.fitness(pop[:], aggregated_equations[:], map_geneIndex_to_variableName[:])
        for i in range(len(pop)):
            tmp_chld = MUT(pop[i][:])
            if genetic_algorithm.fitness([tmp_chld], aggregated_equations, map_geneIndex_to_variableName)[0] < fitness_values[i]:
                pop[i] = tmp_chld
        return pop
